import './Selector.css';
import { useMain } from '../states/main_state'; // adjust the path as necessary



const Selector = () => {
  const { setCurrentMain } = useMain();

  const handleClick = (name) => () => {
    setCurrentMain(name);
    console.log("current_layout updated to overview_layout");
  };

  return (
    <div className="selector">
      <div className="selector_header">
        <h2>Welcome to Skynet.</h2>
      </div>
      <div className="selector_body">
        <p>select an option</p>
        <div className="selector_options">
            <button className="option"  >Overview</button>
            <button className="option"  >Alfa</button>
            <button className="option"  >Beta</button>
        </div>
      </div>  
    </div>
  );
};

export default Selector;
